import logo from './Patenca.png';
import './App.css';

const App = () => {
  return (
    <div>
      <title> AI consultant </title>
      <h1>Your balance:</h1>

      <div className="separator"></div>
      <br />
     <h2> Income</h2>
     <h2> Expense</h2>
      <p>
        <img className='ai' src="/Screenshot 2025-03-20 130759.png" alt="our AI" />
      </p>
    </div>
  );
}

export default App;
